/* eslint-disable */
const createDtoInSchemaType = shape({
  "severity": oneOf(["INFO","WARNING","ERROR","CRITICAL"]).isRequired(),
  "logTypeCode": string().isRequired(),
  "message": string().isRequired(),
  "logData": shape({}, true, 131072) // 128 kB
});

const deleteBeforeTimeDtoInSchemaType = shape({
  "toTime": datetime().isRequired()
});

const sysLogRecordListDtoInType = shape({
  "timeFrom": datetime(), // timeFrom has to be before timeTo
  "timeTo": datetime(),
  "pageInfo": shape({
    "pageIndex": integer(0, null),
    "pageSize": integer(1, 1000)
  })
});

const sysLogRecordPrivilegedListDtoInType = shape({
  "timeFrom": datetime(), // timeFrom has to be before timeTo
  "timeTo": datetime(),
  "pageInfo": shape({
    "pageIndex": integer(0, null),
    "pageSize": integer(1, 1000)
  })
});

const privilegedDeleteDtoInSchemaType = shape({
  "toTime": datetime().isRequired()
});

/* eslint-enable */
